  "text" : "\uD398\uC544\uB178\uB974 \uC9D1\uC5D0 \uC5C5\uB465\uC774 \uC654\uC74C \uC88B\uACA0\uB2E4. \uD604\uAD00\uC55E\uC5D0 \uC544\uAE30\uAC00 \uB193\uC5EC\uC788\uC5B4\uC11C \uC77C\uACF1 \uC544\uB4E4\uB4E4\uC774 \uC6B0\uC655 \uC6B0\uC655 \uD558\uB294\uB370 \uD398\uC544\uB178\uB974\uAC00 \uB2A5\uC219\uD558\uAC8C \uBCF4\uB4EC\uBCF4\uB4EC\uD574\uC8FC\uB294 \uAC8C \uBCF4\uACE0\uC2F6\uB2E4. \uBD80\uBAA8 \uCC3E\uC744 \uB54C\uAE4C\uC9C0 \uD398\uC544\uB178\uB974\uC758 \uB9C9\uB0B4\uB098 \uB9C8\uC5D0\uC758 \uC790\uC2DD\uC73C\uB85C \uC624\uD574\uBC1B\uC73C\uBA70 \uBCF4\uC0B4\uD54C\uBC1B\uB294 \uB0A8\uBAA8\uB97C \uC544\uAE30. \uC65C \uC37C\uC9C0 \uC774\uAC70..",
