  "text" : "\uAC04\uB9CC\uC5D0 \uD540\uACE8\uD540\uC758 \uBAA8\uB974\uACE0\uC2A4\uB825\uC744 \uC62C\uB9AC\uACE0 \uC2F6\uB2E4(\uC0C8\uC0BC) \uB124\uAC00 \uC751\uD558\uC9C0 \uC54A\uC73C\uBA74 \uB300\uC2E0 \uCFE0\uB8E8\uD540\uC744 \uAC74\uB4DC\uB9AC\uACA0\uB2E4\uACE0 \uD558\uACE0 \uD398\uC544\uB178\uB974\uB97C \uAC00\uC84C\uB294\uB370, \uC0AC\uC2E4 \uCFE0\uB8E8\uD540\uC5D0\uAC8C\uB3C4 \uC774\uBBF8 \uC190\uB300\uACE0 \uC788\uC5C8\uB358 \uD540\uACE8\uD540\uC774\uB77C\uAC70\uB098..\uADF8\uB798\uC11C \uAC70\uD488\uBB34\uB294 \uD398\uC544\uB178\uB974\uB77C\uAC70\uB098..\uADF8\uC800 \uB2E4\uC591\uD55C \uD540\uACE8\uD398\uC544\uB97C \uBCF4\uACE0 \uC2F6\uC744\uBFD0..",
